require.register("slam/lib/ai.js", Function("exports, require, module",
"var debug = require('debug')('ai')\n\
  , geom = require('geom')\n\
  , settings = require('./settings')\n\
  , actions = require('./actions')\n\
  , vec = geom.vec\n\
  , ImprovedNoise = require('./support/improved-noise');\n\
\n\
module.exports = AI;\n\
\n\
function AI( name ){\n\
  debug('created')\n\
  this.name = name;\n\
  this.active = false;\n\
  this.noiseAmount = 0;\n\
  this.guiInit = false;\n\
  this.time = 0;\n\
  this.target = null;\n\
  this.currentConfusionOffsetX = 0;\n\
  //stores logic\n\
  this.brain = {};\n\
\n\
  this.defaults = {\n\
    maxSpeed:20,\n\
    reaction:0.9,\n\
    viewRange:0.6,\n\
    confusion:0\n\
  }\n\
\n\
  this.resetBrain();\n\
\n\
  actions.on('opponentPaddleHit', this.paddleHit.bind(this) )\n\
}\n\
\n\
AI.prototype = {\n\
\n\
  resetBrain: function(){\n\
    debug('reset brain')\n\
\n\
    this.time = 0;\n\
    this.brain = {};\n\
    for( var key in this.defaults ) {\n\
      this.brain[key] = this.defaults[key];\n\
    }\n\
  },\n\
\n\
  updateBrain: function( data ) {\n\
    debug('update brain',data)\n\
\n\
    this.resetBrain();\n\
\n\
    for( var key in data ) {\n\
      if( this.brain.hasOwnProperty(key) ){\n\
        this.brain[key] = data[key];\n\
      }\n\
    }\n\
\n\
    if( !this.guiInit && settings.gui && this.name == 'game'){\n\
\n\
      this.guiInit = true;\n\
\n\
      var f = settings.gui.addFolder('AI')\n\
\n\
      for( key in this.defaults ) {\n\
        if( key == 'maxSpeed' ){\n\
          f.add(this.brain,key).min(0).max(20).step(0.1).listen();\n\
        } else {\n\
          f.add(this.brain,key).min(0).max(1).step(0.1).listen();\n\
        }\n\
      }\n\
\n\
    }\n\
\n\
  },\n\
\n\
  paddleHit: function(){\n\
    this.currentConfusionOffsetX = Math.random()*500-250;\n\
  },\n\
\n\
  start: function(){\n\
    debug('start')\n\
    this.active = true;\n\
    this.noiseAmount = 0;\n\
  },\n\
\n\
  stop: function(){\n\
    debug('stop')\n\
    this.active = false;\n\
    this.time = 0;\n\
  },\n\
\n\
  setTarget: function(target){\n\
    debug('set target',target)\n\
    this.target = target;\n\
  },\n\
\n\
  update: function(world){\n\
    // skip if target doesn't exist (yet)\n\
    if( !this.active || this.target === null || !world.bodies.has(this.target) ){\n\
      return false;\n\
    }\n\
\n\
    // find closest puck\n\
    var closest = null\n\
      , minDist = settings.data.arenaHeight*this.brain.viewRange\n\
      , target = world.bodies.get(this.target)\n\
      , current = target.current\n\
      , paddleWidth = (target.aabb[1]-target.aabb[3])*0.5;\n\
\n\
    for(var i=0; i < world.pucks.length; i++){\n\
      var puck = world.pucks.values[i]\n\
        , testPos = [puck.current[0],current[1]]\n\
        , dist = vec.distSq(testPos,puck.current)\n\
\n\
      minDist *= minDist\n\
\n\
      if( dist < minDist ){\n\
        minDist = dist;\n\
        closest = puck;\n\
      }\n\
    }\n\
\n\
    // no puck found\n\
    var targetX = settings.data.arenaWidth*0.5;\n\
    if( closest ) {\n\
      targetX = closest.current[0] + this.currentConfusionOffsetX*this.brain.confusion*0.5;\n\
    } else {\n\
      targetX += this.currentConfusionOffsetX*this.brain.confusion;\n\
    }\n\
\n\
    if(this.noiseAmount<1){\n\
      this.noiseAmount+= 0.004;\n\
    }\n\
\n\
    //offset target with confusion\n\
    targetX += this.currentConfusionOffsetX*this.brain.confusion*0.3*this.noiseAmount;\n\
\n\
    this.time += 0.1;\n\
\n\
    targetX += Math.sin(this.time*2.2)*40*this.noiseAmount*this.brain.confusion;\n\
\n\
    if( closest && closest.velocity[1] < 0 ){\n\
      current[0] += Math.max(-this.brain.maxSpeed, Math.min(this.brain.maxSpeed,( targetX - current[0])))*this.brain.reaction;\n\
\n\
    } else {\n\
      current[0] += (targetX - current[0])*0.01*this.noiseAmount*this.brain.reaction;\n\
    }\n\
\n\
    if( current[0] > settings.data.arenaWidth - paddleWidth) {\n\
      current[0] = settings.data.arenaWidth - paddleWidth;\n\
    } else if( current[0] < paddleWidth) {\n\
      current[0] = paddleWidth;\n\
    }\n\
\n\
    // ai has moved, let them know\n\
    return true;\n\
  }\n\
\n\
}//@ sourceURL=slam/lib/ai.js"
));
